		txtZPosition:SetValue(zpos)
		txtZDepth:SetValue(depth)
		txtRapidHeight:SetValue(rapidh)
		txtFeedHeight:SetValue(feedh)
		txtPlungeFeed:SetValue(plungef)
		txtCutFeed:SetValue(cutf)
		txtRPM:SetValue(rpm)
