	end
	
	return zpos, depth, rapidh, feedh, plungef, cutf, rpm, font
end

local function SetVals()
	post.ClearSettings()
	local height = txtHeight:GetValue()
	local xpos = txtXPos:GetValue()
	local ypos = txtYPos:GetValue()
	post.setHeight(tonumber(height))
	post.setXStart(tonumber(xpos))
	post.setYStart(tonumber(ypos))
	
	local zpos, depth, rapidh, feedh, plungef, cutf, rpm = LoadParams(true)
	post.setRapidHeight(zpos + rapidh)
	post.setFeedHeight(zpos + feedh)
	post.setDepth(zpos - depth)
	post.setFeedPlung(plungef)
	post.setFeedCut(cutf)
	post.setRPM(rpm)
	
	return true
end

local function Update()
	local txt = AssembleLines()
	SetVals()
	local gcode, ll = GenGcode(txt)
	local length = 0
	for _,l in ipairs (ll) do
		if (l > length) then
			length = l
		end
	end
	txtWidth:SetValue(string.format("%.4f", length))
end

