local function CreateFont()
    scale = 1;
	xshift = 0;
	yshift = 0;
	ascii = 33

	-- Vars to show mode and position
	linecnt = 1
	xcur = 0;
	xval = 0;
	xvallast = 0;
	xmax = -9999;
	xmin = 9999;
	xfirst = 0;
	xcuract = 0;
	xlast = 0;
	xstart = 0;
	ystart = 0;
	ycur = 0;
	icur = 0;
	jcur = 0;
	zdn = true;
	Zmove = false;
	movemode = -1;

	header = ""
	header = header .. "-----------------------------------------------------------------------------\n"
	header = header .. "-- Name:        Straight Font Module\n"
	header = header .. "-- Author:      Font Creator Script\n"
	header = header .. "-- Created:     " .. os.date("%x") .. "\n"
	header = header .. "-- Copyright:   (c) 2015 Newfangled Solutions. All rights reserved.\n"
	header = header .. "-- License:    \n"
	header = header .. "-----------------------------------------------------------------------------\n"
	header = header .. "local mcStraightFont = {}\n"
	header = header .. "local inst = mc.mcGetInstance()\n"
	header = header .. "local MachDirectory = mc.mcCntlGetMachDir(inst)\n"
	header = header .. "local Profile = mc.mcProfileGetName(inst)\n"
	header = header .. "local ScriptPath = MachDirectory .. '/Modules/AddOns/FontEngraving/?.lua;'\n"
	header = header .. "local spos = string.find(package.path, ScriptPath)\n"
	header = header .. "if (spos == nil) then \n"
	header = header .. "	package.path = package.path .. ';' .. ScriptPath\n"
	header = header .. "end\n"
	header = header .. "local f = require 'mcFPost'\n"
	header = header .. "setmetatable(mcStraightFont, {__index = f})\n"
	header = header .. "_ENV = mcStraightFont\n\n"
	header = header .. "ascii32 = function ()\n"
	header = header .. "return ( AddWidth(.75) );\n"
	header = header .. "end\n\n"
	

local spos = string.find(package.path, ScriptPath)
if (spos == nil) then 
	package.path = package.path .. ";" .. ScriptPath
end
	
	--header = header .. string.format("ascii%.0f = function ()\n", ascii)

	local function RemoveComment(str)
		local rvel = str;
		rvel = string.gsub(tostring(str), '%b()', '');
	return (rvel)
	end

	local function GetNumber(str)
		local val = '';
		local i = 0;
		for i=1, str:len(),1 do
			local c = string.byte(str, i)
			if ((c >= 48 and c <= 57) or c== 46 or c== 45) then
				val = val .. string.char(c);
			else
				return(tonumber(val))
			end
		end
		return(tonumber(val))
	end

	local function Convertline(gline);
		gline = RemoveComment(gline)
		gline = gline:upper();
		move = false;
		Zmove = false;
		local length = string.len(gline);
		local i = 1;
		local c = '';
		for i=1, length,1 do
			c = string.sub(gline, i, i);
			if (_G[c] ~= nil) then
				i = _G[c](gline, i);
			end
		end
		local retval = '';
		if(Zmove == true) then
			if (zdn == true)then
				retval = 'ZDn()\n'
			else
				retval = 'ZUp()\n'
			end
		else
			if(movemode == 0 or movemode == 1) then
				retval = string.format('G%i(%.5f,%.5f)\n', movemode, xcur, ycur);
			elseif(movemode == 2 or movemode == 3) then 
				retval = string.format('G%i(%.5f,%.5f,%.5f,%.5f)\n', movemode, xcur, ycur, icur, jcur);
			end
		end
		linecnt = linecnt + 1
		return (retval)
	end

	local function G(gline, i)
		i= i+1;
		local str = string.sub(gline, i, gline:len())
		local mode = GetNumber(str);
		if(tonumber(mode) >= 0 and tonumber(mode) <= 3) then
			movemode = mode;
		end
		return (i)
	end

	local function X(gline, i)
		i= i+1;
		local str = string.sub(gline, i, gline:len())
		xcur = GetNumber(str);
		xcuract = xcur
		xcur = (xcur * scale ) + xshift;
		xcur = xcur - xmin
		if (xcur > xlast) then
			xlast = xcur
		end
		return i, xcuract
	end

	local function Y(gline, i)
		i= i+1;
		local str = string.sub(gline, i, gline:len())
		ycur = GetNumber(str);
		ycur = (ycur * scale ) + yshift;
		return (i)
	end

	local function I(gline, i)
		i=i+1
		local str = string.sub(gline, i, gline:len())
		icur = GetNumber(str)
		icur = (icur * scale)
		return(i)
	end

	local function J(gline, i)
		i=i+1
		local str = string.sub(gline, i, gline:len())
		jcur = GetNumber(str)
		jcur = (jcur * scale)
		return(i)
	end

	local function Z(gline, i)
		i= i+1;
		local str = string.sub(gline, i, gline:len())
		local Zval = GetNumber(str);
		if(Zval > 0 and zdn == true) then 
			Zmove = true
			zdn = false
		elseif(zdn == false) then 
			Zmove = true
			zdn = true

		end
		return (i)
	end

	local function ConvertFile(Gcodefile, FontFile)
		FontFile:write(header)
		local gline = Gcodefile:read('*line') --Get the first line
		local index = 1
		local gstr = {}
		local startposx = 1
		local startposy = 1
		while gline~=nil do --check to see if we have a valid line
			--index lines into a table
			gstr[index] = RemoveComment(gline)
			gstr[index] = gstr[index]:upper()
			local str = gstr[index]
			local xchar = string.find(str, "X")
			local ychar = string.find(str, "Y")
			--find x vals to find the min, max positions and the end of the character
			if (xchar ~= nil) then
				local xstr = string.sub(str, (xchar + 1), str:len())
				xval = GetNumber(xstr)
				if (startposx == 1) then
					xstart = (xval * scale) + xshift
					startposx = 0
				end
				if (xval < xmin) then
					xmin = xval
				end
				if (xval > xmax) and ((xval - xvallast) < 1)then
					xmax = xval
				end
			end
			if (startposy == 1) and (ychar ~= nil) then
				local ystr = string.sub(str, (ychar + 1), str:len())
				yval = GetNumber(ystr)
				ystart = (yval * scale) + yshift
				startposy = 0
			end
			if ((xval - xvallast) > 2) then
				--write character start
				local newsec = string.format("-- %s\n", string.char(ascii))
				newsec = newsec .. string.format("ascii%.0f = function()\n", ascii)
				newsec = newsec .. "ZUp()\n"
				newsec = newsec .. string.format('G%i(%.5f,%.5f)\n', 0, (xstart - xmin), ystart);
				FontFile:write(newsec)
				--write indexed lines to file
				for i = 1, (index-1), 1 do
					local s = Convertline(gstr[i]);
					FontFile:write(s);
				end
				--end section
				local endsec = string.format("return (AddWidth(%.3f))\n", (xmax - xmin))
				endsec = endsec .. "end\n\n"
				FontFile:write(endsec)
				--reset values for next round
				xmin = 9999
				xmax = -9999
				xlast = 0
				index = 1
				startposx = 1
				startposy = 1
				ascii = ascii + 1
			else
				index = index + 1
			end
			
			xvallast = xval
			gline = Gcodefile:read('*line')
		end
		local footer = "\nreturn mcStraightFont\n";
		FontFile:write(footer);
	end

	--Funcs {}
	--Funcs['G'] = G

	-- create the wxFrame window
	mainframe = wx.wxFrame( wx.NULL,          -- no parent
							wx.wxID_ANY,          -- whatever for wxWindow ID
							"DummyFrame", -- frame caption
							wx.wxDefaultPosition, -- place the frame in default position
							wx.wxDefaultSize,     -- default frame size
							wx.wxDEFAULT_FRAME_STYLE ) -- use default frame styles

		-- create a panel in the frame
	panel = wx.wxPanel(mainframe, wx.wxID_ANY)--We are not going to show it but we need to have this to use the File dialog

	local file = wx.wxFileDialog(panel, "Select Font File To Convert", "", "", "NC files (*.nc)|*.nc|Text files (*.txt)|*.txt|Tap files (*.tap)|*.tap", 
								 wx.wxFD_OPEN,wx.wxDefaultPosition,wx.wxDefaultSize, "File Dialog" );
	if(file:ShowModal() == wx.wxID_OK)then
		local path = file:GetPath();
		local dir;
		local filename;
		dir,filename = wx.wxFileName.SplitPath(path)
		local FontCode = dir .. '\\' .. filename ..'.lua';
		local Gcodefile = io.open(path, 'r');
		local FontFile = io.open(FontCode, 'w+');
		ConvertFile(Gcodefile, FontFile);
		FontFile:flush();
		Gcodefile:close();
		FontFile:close();
		wx.wxMessageBox('Input : ' .. path .. '\nOutput : ' ..  FontCode , 'File Converted', wx.wxICON_ERROR)
	end 
end

