		--save new file
		local file = wx.wxFileDialog(tabEngrave, "Select Gcode File", "", "", "NC files (*.nc)|*.nc|Text files (*.txt)|*.txt|Tap files (*.tap)|*.tap", 
							  wx.wxFD_SAVE,wx.wxDefaultPosition,wx.wxDefaultSize, "Save Engraving GCode" );
		if (file:ShowModal() == wx.wxID_OK) then
			local gcodepath = file:GetPath()
			local gcodefile = io.open(gcodepath, "w")
			gcodefile:write(gcode)
			gcodefile:close()

			--load new gcode
			mc.mcCntlLoadGcodeFile(inst, gcodepath)
			mc.mcToolPathGenerate(inst)
		end
		
		IncrementSN()
	end )

